import React from 'react';
import './Components.css';

const MainMenu = () => {
  return (
    <nav  className="Header-menu-class">
        <a href="/" aria-current="page" class="cvat-brand w-nav-brand w--current" aria-label="home">
            <img src="https://uploads-ssl.webflow.com/62bebfb83044de7f13ae257e/62bec02423796903b293473e_Logo.svg" loading="lazy" alt=""/>
        </a>
        <ul>
            <li className="Header-menu-class">
                <a href={'https://twitter.com/'} >Home</a>
            </li>
            <li className="Header-menu-class">
                <a>Battle Royale</a>
            </li>
            <li className="Header-menu-class">
                <a>Creative</a>
            </li>
            <li className="Header-menu-class">
                <a>Save the World</a>
            </li>
        </ul>
    </nav>
  );
}

export default MainMenu;
